package com.zj.curd.pojo;

public class Company {
	private Integer companyId;
	private String companyName;
	private String companyAddress;
	private Integer companyIncome;
	private String companyLogo;
	private Integer companySort;
	public Company() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Integer getCompanyId() {
		return companyId;
	}
	public void setCompanyId(Integer companyId) {
		this.companyId = companyId;
	}
	public String getCompanyAddress() {
		return companyAddress;
	}
	public void setCompanyAddress(String companyAddress) {
		this.companyAddress = companyAddress;
	}
	public Integer getCompanyIncome() {
		return companyIncome;
	}
	public void setCompanyIncome(Integer companyIncome) {
		this.companyIncome = companyIncome;
	}
	public String getCompanyLogo() {
		return companyLogo;
	}
	public void setCompanyLogo(String companyLogo) {
		this.companyLogo = companyLogo;
	}
	public Integer getCompanySort() {
		return companySort;
	}
	public void setCompanySort(Integer companySort) {
		this.companySort = companySort;
	}
	public String getCompanyName() {
		return companyName;
	}
	public void setCompanyName(String companyName) {
		this.companyName = companyName;
	}
	
	
}
